import React from "react";

const SearchBar = (props) => {

  const handleSearchChange = (event) => {
    props.setQuery((prevState) => ({
      ...prevState,
      name: event.target.value
    }));
  };

  return (
    <div>
      <form>
        <input id="searchbar" type="text" placeholder="Search.."></input>
      </form>
    </div>
  );
};

export default SearchBar;
